import React from "react";
import { View, Text } from "react-native";

const Error = ({ getTodos }) => {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>500 || Internal Server Error</Text>
    </View>
  );
};

export default Error;
